# ╔═╡ bf5e5d3b-68dc-4675-b34c-216dda0b7952
md"""
## 4 Bond Market

Holders of ``A`` can stake (select) a bond maturity from the set of **standard maturities**. Bonds expire every 90 days on a rolling basis. There are always 40 maturities extending out to approximately 10 years for bond staking.

- Collective Bond staking detemines the shape of the discount curve of the ``A`` token with regards to its purchasing rate of forward Carbon

- Bondholders receive a floating yield of new ``A`` tokens on their stake following the shape of this discount curve. Yield is calculated daily and accumulates to the principal stake.

- There is no un-staking and all principal and accumulated yield is released at bond maturity.

``G`` Tokens are not involved in the bond market and the forward curve is agnostic to Carbon class (as Carbon selection for portfolio weighting is an independent utility function of ``A``).
"""

# ╔═╡ 5848ebca-a639-471c-9832-af39ded7c005
md"""
### 4.1 Bond Market Calculations

Defining:

- ``S``: Total ``A`` tokens staked for Bonds expressed as a proportion of outstanding supply of ``A``.

- ``S_t``: Total ``A`` tokens staked for each Bond maturity bucket ``t``, expressed as a proportion of outstanding supply of ``A``, where ``\sum S_t = S``, and ``t`` is the index of standard maturities ``t \in \{ 1, 2, \dots, 40 \}.``

- ``E_t``: Time to expiry expressed in years.
"""

# ╔═╡ 21844b3c-75af-4328-94f1-c3c20e1a80e1
"Function to produce a linear ``\\vec S`` parametrized by its slope"
function linear(S, E⃗, D_input, C_input)
    isone(length(E⃗)) && return [S]

    t₁ = firstindex(E⃗)
    t₂ = lastindex(E⃗)
    slope = 0.002 * atanh(D_input)
    intercept = S / length(E⃗)

    if abs(slope) > 2 * intercept / (t₂-t₁-1)
        t_shift = max(1, round(sqrt(abs(2 * S / slope))))
        if slope > 0
            t₁ = t₂ - t_shift
        else
            t₂ = t₁ + t_shift
        end
        slope = sign(slope) * 2 * S / (t₂-t₁)^2
        intercept = abs(slope) * (t₂-t₁-1)/2
    end

    t = eachindex(E⃗) .- (t₁.+t₂)./2
    S⃗ = max.(0, slope .* t .+ intercept)

    return S⃗
end

# ╔═╡ 4f54f3f7-e43e-40af-a6fa-953e6119bd12
"Function to produce ``\\vec S`` with two staked maturities that can create all the possible combinations of the paramters ``D`` and ``C``"
function exhaustive(S, E⃗, D_input, C_input)
    center = (D_input + 1) / 2
    D = center * (maximum(E⃗)-minimum(E⃗)) + minimum(E⃗)
    D = round(D / step(E⃗)) * step(E⃗)

    deviation = (C_input + 1) / 2
    E⃗₁ = D - deviation * (D-minimum(E⃗))
    E⃗₂ = D + deviation * (maximum(E⃗)-D)

    t₁ = searchsortedfirst(E⃗, E⃗₁ - step(E⃗)/2)
    t₂ = searchsortedfirst(E⃗, E⃗₂ - step(E⃗)/2)

    S⃗ = zero(E⃗)
    if t₁ == t₂
        S⃗[t₁] = S
    else
        S⃗[t₁] = S * (D-E⃗[t₂]) / (E⃗[t₁]-E⃗[t₂])
        S⃗[t₂] = S - S⃗[t₁]
    end
    return S⃗
end

# ╔═╡ 1dde6d62-13b9-4467-bef1-8ef068a70eb0
md"Calculating curve parameters ``D``, ``C``:"

# ╔═╡ d3f5636d-6134-4572-bec7-10d321766abe
texeq"D = \frac 1 S \sum_{t=1}^{40} S_t E_t"

# ╔═╡ ba0014ad-4aeb-46b4-99f3-897412b921d4
texeq"C = \frac 1 S \sum_{t=1}^{40} S_t E_t^2"

# ╔═╡ 8e01f292-7f07-4c3e-85be-43c3bfbbe80a
md"The shape of the yield curve ``\gamma_t`` is produced:"

# ╔═╡ e47eaa16-ffd4-4b7a-825b-2c75bf2ea9ee
texeq"\gamma_t = \max \left( \frac{E_t}{D} - \frac{E_t^2}{2 C}, 0 \right)"

# ╔═╡ 6955127f-bd1e-474b-9c0c-8a8cb332330e
md"Normalising ``\gamma_t`` to ``\hat\gamma_t``:"

# ╔═╡ 7e7ddd23-0904-4b0c-baa9-cc722ac6ce0b
texeq"\hat\gamma_t = \frac{\gamma_t}{\sum_{t=1}^{40} \gamma_t}"

# ╔═╡ 7a1c1627-e344-4083-997d-027880924cbc
md"With the cumulative sum of the normalised values be expressed as ``\Gamma_t``:"

# ╔═╡ c2eb5f5c-3cb4-4f88-84c6-1151f739a353
texeq"\Gamma_t = \sum_{i=1}^t \hat\gamma_i \quad \text{for } t = 1, \dots, 40"

# ╔═╡ 920ec431-8cab-4716-bba1-8f9fe1c398a1
md"The zero coupon yield curve ``Z_t`` is solved:"

# ╔═╡ 79887d77-a860-44c8-94ca-d01e82f201c0
texeq"Z_t = (1-S) \frac{\Gamma_t}{E_t}"

# ╔═╡ 702873b9-9026-42ea-a80e-0c365495f5af
md"Finally, the Bond discount rate $B_t$ is derived:"

# ╔═╡ 6a9fb8f7-e284-47c8-8caa-254cc854768c
texeq"B_t = \exp(-Z_t E_t)"

# ╔═╡ ecf08d58-0fbc-4585-afb8-9687cf691788
md"The yield due on ``A`` bonds is calculated daily and added to staked principal, hence the daily yield for each time bucket is calculated as ``Y_t``:"

# ╔═╡ 608bb8ab-97a6-433b-a59a-98dcf30848f3
texeq"Y_t = \exp \left( \frac{Z_t}{365} \right) - 1"

# ╔═╡ f14cd551-bfae-423b-ba53-a632022965bb
md"Hence, any bond stake ``A_t`` will increase by ``\Delta A_t``"

# ╔═╡ 4246969c-fb8f-48b5-9d91-37bdf22f5b5d
texeq"\Delta A_t = A_t Y_t"

# ╔═╡ 91543958-7a50-44ec-9da7-c27da1f26657
md"The total tokens created on a daily basis for Bond inflation ``R``:"

# ╔═╡ 44148390-384c-4208-adb0-4d1fe0ddcee0
texeq"R = \sum_{t=1}^{40} \Delta A_t"

# ╔═╡ bee8cc34-97ff-4cad-86a5-86d53775006e
md"""
