- Shape of ``\vec S``: $(@bind S⃗_function Select([linear, exhaustive]))

- Total stake ``S =`` $(@bind S_input Scrubbable([0.001; 0.01; 0.05:0.05:1], default=0.55, format=".1%"))

- Inflation ``I =`` $(@bind I Scrubbable(0:0.0002:0.1, default=0.0202, format=".2%"))

