- Parameter ``D``: $(@bind D_input Slider(-1:0.1:1, default=-0.3))

- Parameter ``C``: $(@bind C_input Slider(-1:0.1:1, default=0))

- Render 3D plot (slow interactions)? $(@bind is_shown_3d_ΔAₜ CheckBox(default=true))
"""

# ╔═╡ 52faf401-1397-4370-abb1-305ace0505c7
"Total ``A`` tokens staked for Bonds expressed as a proportion of outstanding supply of ``A``."
S = S_input  # Take value from interactive slider below

# ╔═╡ 5ff3bf26-7740-44ea-9669-5c0008d3d8f0
"Times to expiry expressed in years"
E⃗ = 0.25:0.25:E⃗_input

# ╔═╡ 1eecfc51-a33d-46a5-a547-20246bf39d2b
"Vector of the total ``A`` tokens staked for each Bond maturity bucket, expressed as a proportion of outstanding supply of ``A``, where ``\\operatorname{sum}(\\vec S) = S``"
S⃗ = S⃗_function(S, E⃗, D_input, C_input)  # Select between two functions below

# ╔═╡ 840872db-935e-4194-a6a6-67c1110178d9
"""
Mean of the times to expiry weighted by the proportions of staked ``A`` tokens

``D = \\operatorname{mean}_\\vec S (\\vec E) = \\frac{\\vec S \\cdot \\vec E}{S}``
"""
D = S⃗' * E⃗ / S

# ╔═╡ 0ef2392c-7e22-4d7d-883e-fb36c14f8475
"""
Mean of the squared times to expiry weighted by the proportions of staked ``A`` tokens

``C = \\operatorname{mean}_\\vec S (\\vec E \\odot \\vec E) = \\frac{\\vec S \\cdot (\\vec E \\odot \\vec E)}{S}``, where ``\\odot`` denotes the Hadamard (element-wise) product
"""
C = S⃗' * (E⃗ .* E⃗) / S

# ╔═╡ 1bc8a72e-0ed4-4e86-aa57-c57972870410
"Yield ``\\vec \\gamma = \\max.\\left( \\frac{\\vec E}{D} - \\frac{\\vec E \\odot \\vec E}{2 C}, 0 \\right)``, where ``\\max.(\\vec v, 0)`` denotes the positive part of a vector ``\\vec v``"
γ⃗ = max.(0, E⃗ ./ D .- E⃗ .* E⃗ ./ (2 .* C))

# ╔═╡ ea15469b-4627-473b-88f0-15c78c044062
"Normalized yield ``\\hat{\\vec \\gamma} = \\frac{\\vec \\gamma}{\\operatorname{sum}(\\vec \\gamma)}``"
γ⃗̂ = γ⃗ ./ sum(γ⃗)

# ╔═╡ b0f5f86a-5f63-46cc-9151-a6ee7317eef3
"Cumlative sum of the normalized yield ``\\vec\\Gamma = \\operatorname{cumsum}(\\hat{\\vec\\gamma})``"
Γ⃗ = cumsum(γ⃗̂)

# ╔═╡ 5a2b79fa-72ee-4c42-b8c4-3210ae150fb1
"Zero-coupon yield ``\\vec Z = (1-S) (\\vec \\Gamma \\oslash \\vec E)``, where ``\\oslash`` denotes the Hadamard division"
Z⃗ = (1 .- S) .* Γ⃗ ./ E⃗

# ╔═╡ fccced39-10d8-4187-baf2-90508f12c885
"Yield due on ``A`` bonds ``\\vec Y = \\exp. \\left( \\frac{\\vec Z}{365} \\right) - 1``"
Y⃗ = exp.(Z⃗ ./ 365) .- 1

# ╔═╡ e59f94d1-a2f3-4327-9a0a-33beaedd351c
"Bond discount rate ``\\vec B = \\exp.(-\\vec Z \\odot \\vec E)``, where ``\\exp.(\\vec v)`` is the element-wise exponential"
B⃗ = exp.(-Z⃗ .* E⃗)

