# ╔═╡ 95f2d6d5-294e-4aa0-85df-6b22553a1a65
md"""
## 5 Governance

Governance rights, for example the whitelisting (blacklisting) of Carbon classes, and any other matter requiring token stakeholder voting, are allocated to two cohorts:

1. Bond staking: ``S_t``

2. Locked liquidity in the ``A`` -- ``G`` pair ``\overline{AG}`` (see Section 7) defined here as ``A_{Gt}`` representing the quantity of ``A`` tokens held in the liquidity pool expressed as a proportion of circulating supply.

Voting power is allocated by time and applied to the respective balance of ``A``:

1. Initial voting weights for Bonds ``v_t``:
"""

# ╔═╡ 629dff6d-f35a-4d03-a68f-0aa509b63277
texeq"v_t = Z_t S_t B_t"

# ╔═╡ 69db1eee-f427-40b8-afdf-4c4791142615
md"2. Initial voting weights for LPs ``w_t``:"

# ╔═╡ b1915f28-0393-43f9-9bf7-400efd9d41e0
texeq"w_t = Z_t A_{Gt} B_t"

# ╔═╡ 01b4c2b9-e838-469e-b77d-0959e7b45223
md"1. Final voting weights Bonds ``V_t``:"

# ╔═╡ 5205b155-fad2-4212-99ca-1fca7db8a576
texeq"V_t = \frac{v_t}{\sum_{j=1}^{40} (v_j + 2 w_j)}"

# ╔═╡ 33dd21a4-cbc9-49a4-9107-170c1b745dfd
md"2. Final voting weights LPs ``W_t``:"

# ╔═╡ c8ca410a-efeb-4358-b957-ad165d2953aa
texeq"W_t = \frac{w_t}{\sum_{j=1}^{40} \left( \frac 1 2 v_j + w_j \right)}"

# ╔═╡ 56474a93-feec-40c7-abb2-e9ffbc914ed0
md"## 6 Automated Asset Manager"

# ╔═╡ 85851154-d625-4a55-bae4-db08451834dc
md"""
### 6.1 Carbon Sales (AAM Purchase)

#### 6.1.1 Existing Carbon in the Portfolio

Carbon classes ``i \in \{1, 2, 3, \dots, n\}`` are whitelisted through governance by the ``A`` token and the ``\overline{AG}`` LP holders (see Section 5).

For Carbon pricing, both the ``A`` tokens and the ``G`` tokens may stake for specific Carbon classes ``C_i`` and these are independent stakes between the two token systems.
"""

# ╔═╡ 71d4dc9f-e06e-4be9-aab2-0e299a6d48d5
md"""
Figure 8: Token Staking Class Structure

![Token Staking Class Structure](data:image/png;base64,)
"""

# ╔═╡ 08b475da-ba83-411d-b85a-a5621483429b
md"""
For a Carbon class quantity to be sold to the AAM, it must have a strictly positive quantity of ``A`` tokens staked for that Carbon class, otherwise there is no price, and the Carbon cannot be sold.

Defining:

- ``A``: Total ``A`` tokens staked for pricing of Carbon classes, expressed as a proportion of outstanding supply of ``A`` Tokens.

- ``C_i``: Total tonnes of Carbon class ``i`` currently held in the portfolio.

- ``A_i``: ``A`` tokens staked for Carbon class ``i`` expressed as a proportion of outstanding supply of ``A`` Tokens where ``\sum A_i = A``.

- ``G_i``: ``G`` tokens staked for class ``i`` expressed as a proportion of outstanding supply of ``G`` Tokens.

- ``C_{it}``: The quantity of Carbon class ``i`` held in the AAM deliverable per maturity ``t`` where ``C_{i0}`` reflects the liquid quantity.
"""

# ╔═╡ 98170711-066e-4401-ab26-1c62eca43f78
md"""
In order to determine the present-value quantity of Carbon, ``\bar C_i``, we apply the discount curve from Equation (7) to the liquidity schedule and sum the discounted holdings:
"""

# ╔═╡ bb8af1e8-ac88-4d22-a182-924a85649080
texeq"\bar C_i = C_{i0} + \sum_{t=1}^{40} B_t C_{it}"

# ╔═╡ b573e0c6-a0f4-4cd8-a8d5-58f52be4a224
md"Similarly, taking ``\Delta C_{it}`` as the quantity of Carbon ``i`` to be sold with a specific maturity index ``t``."

# ╔═╡ 24707b12-eba5-4d55-be4e-b5edb06cd0d8
texeq"\Delta \bar C_i = \Delta C_{i0} + \sum_{t=1}^{40} B_t \, \Delta C_{it}"

# ╔═╡ 758de067-d5d6-4e86-8d34-b9f83d4e0449
md"Once standardised by the discount curve, trades can be agglomerated in the same class for the defined trade or auction period."

# ╔═╡ 4dd999e1-f42f-4005-8ce5-66b92662ce09
md"""
**Interactive Values**

- Liquid quantity of carbon class ``i`` held in the AAM ``C_{i0} =`` $(@bind Cᵢ₀_sale Scrubbable([0; 0.001; 0.01; 0.05:0.05:1], default=0.5, format=".1%"))

- Slope of carbon class ``i`` liquidity schedule ``\vec C_{i\text{-slope}}``: $(@bind C⃗ᵢ₋ₛₗₒₚₑ_sale Slider(-1:0.1:1, default=0))

- Number of tonnes of carbon class ``i`` held in the AAM ``C_i =`` $(@bind Cᵢ_sale Scrubbable(Int.(round.(exp10.(0.0:0.4:8); sigdigits=1)), default=1_000_000)) tonnes

- Number of tonnes of carbon class ``i`` sold to the AAM ``\Delta C_{i\text{-tonnes}} =`` $(@bind ΔCᵢ₋ₜₒₙₙₑₛ_sale Scrubbable(Int.(round.(exp10.(0.0:0.4:8); sigdigits=1)), default=600)) tonnes

- Maturity index of carbon class ``i`` sold to the AAM ``t``: $(@bind t_sale_input Slider(0:0.1:1))
"""

# ╔═╡ 88c79a9b-be30-4091-afe0-c37183a43800
"Carbon liquidity schedule: quantity of carbon class ``i`` held in the AAM at each maturity"
C⃗ᵢ_sale = linear(1-Cᵢ₀_sale, E⃗, C⃗ᵢ₋ₛₗₒₚₑ_sale, 0.0)

# ╔═╡ 0c3f487d-e179-44c8-9b6a-a35670d02e73
"Present-value quantity of carbon class ``i`` held in AAM ``\\bar C_i = C_{i0} + \\vec B \\cdot \\vec C_i``"
C̄ᵢ_sale = Cᵢ₀_sale + B⃗' * C⃗ᵢ_sale

# ╔═╡ 6c04c923-263f-47e5-907c-128d267d110a
"Maturity index of carbon class ``i`` to be sold to the AAM"
t_sale = round(Int, t_sale_input * length(E⃗))

# ╔═╡ d63681aa-e4ac-4847-bbb4-a91fbb4fbe7e
"Liquid quantity of carbon class ``i`` to be sold to the AAM"
ΔCᵢ₀_sale = iszero(t_sale) ? (ΔCᵢ₋ₜₒₙₙₑₛ_sale / Cᵢ_sale) : 0.0

# ╔═╡ e6d19a05-7da9-476d-a1aa-9d454168e4ef
"Locked quantity of carbon class ``i`` to be sold to the AAM at each maturity"
ΔC⃗ᵢ_sale = iszero(t_sale) ? zero(E⃗) : setindex!(zero(E⃗), ΔCᵢ₋ₜₒₙₙₑₛ_sale / Cᵢ_sale, t_sale)

# ╔═╡ 1ca58464-3aed-4bd5-b9c7-462da8efd0af
"Present-value quantity of carbon class ``i`` to be sold to the AAM ``\\Delta \\bar C_i = \\Delta C_{i0} + \\vec B \\cdot \\Delta \\vec C_i``"
ΔC̄ᵢ_sale = ΔCᵢ₀_sale + B⃗' * ΔC⃗ᵢ_sale

# ╔═╡ d85acdd0-2329-48bf-ab77-02a6234800d3
begin
    plt_carbon_liquidity = plot(
        [0; E⃗′],
        100 * [Cᵢ₀_sale; [sum(C⃗ᵢ_sale[t-3:t]) for t in 4:4:length(S⃗)]],
        title="Carbon Held in AAM",
        xlabel="Time to Expiry (Years)",
        ylabel="Percentage (%)",
        label="Liquidity Schedule",
        color=2,
        seriestype=:bar,
        xticks=0:2:length(E⃗′),
        ylimits=(0, 105),
    )
    plot!(
        [100 * C̄ᵢ_sale],
        label="Present-Value C̄ᵢ = $(round(Int, 100 * C̄ᵢ_sale)) %",
        color=2,
        seriestype=:hline,
    )
    plot!(
        E⃗′,
        100 * B⃗′,
        xlabel="Time to Expiry (Years)",
        label="Discount Curve",
        color=5,
        markershape=:circle,
    )

    plt_purchased_carbon_liquidity = plot(
        [0; E⃗′],
        Cᵢ_sale * [ΔCᵢ₀_sale; [sum(ΔC⃗ᵢ_sale[t-3:t]) for t in 4:4:length(S⃗)]],
        title="Carbon Sold to AAM",
        xlabel="Time to Expiry (Years)",
        ylabel="Carbon (Tonnes)",
        label="Sold Carbon",
        color=3,
        seriestype=:bar,
        xticks=0:2:length(E⃗′),
        ylimits=(0, 1.05 * Cᵢ_sale * max(ΔC̄ᵢ_sale, maximum(ΔC⃗ᵢ_sale))),
    )
    plot!(
        [ΔC̄ᵢ_sale * Cᵢ_sale],
        label="Present-Value Sold Carb.",
        color=3,
        seriestype=:hline,
    )

    plot(plt_carbon_liquidity, plt_purchased_carbon_liquidity; legend=:outertopright)
end

# ╔═╡ b0640829-43e7-4def-b7ef-78548682b005
md"Where ``\Delta \bar C_i`` is expressed as the relative increment to its respective pool balance, the amount of ``A`` tokens issued to pay for Carbon, ``\Delta A``, expressed as a proportion of current supply, is determined as:"

# ╔═╡ a5fa7cbf-de58-4c22-bd06-d202bc15e105
texeq"\ln(1 + \Delta A) = \left( A_i - \frac{A_i^2 (1 - G_i)^2}{2} \right) \ln(1 + \Delta \bar C_i)"

# ╔═╡ 23011619-a923-45c7-9cf2-098f847b33c1
md"""
For completeness, denoting the expression on the right hand side of Equation (17) as ``\mathsf{RHS}``:
"""

# ╔═╡ d77803b9-fc6c-461a-874d-9be44605c69d
texeq"\Delta A = \exp(\mathsf{RHS}) − 1"

# ╔═╡ b293775d-ed36-4688-9f94-dda82a4aa13e
"""
Amount of ``A`` tokens issued by the AAM to pay for carbon

``\\Delta A(A_i, G_i, \\Delta \\bar C_i) = \\exp\\left( \\left( A_i - \\frac{A_i^2 (1 - G_i)^2}{2} \\right) \\ln(1 + \\Delta \\bar C_i) \\right) - 1``
"""
ΔA_sale(Aᵢ, Gᵢ, ΔC̄ᵢ) = exp((Aᵢ - (Aᵢ^2 * (1-Gᵢ)^2 / 2)) * log(1+ΔC̄ᵢ)) - 1

# ╔═╡ 72fbe14a-fb48-423f-8db5-d634ab88c953
md"Finally, ``\Delta A`` is applied to the outstanding supply of ``A`` to solve for token quantities."

# ╔═╡ d6b2ab74-86e8-4372-9eaf-229cfd230109
md"Figure 9 illustrates the ``G`` token capacity to maintain the initial portfolio pricing of the ``A`` token. The data has been normalised in Figure 10 to ``\Delta \bar C_i A_i``."

# ╔═╡ d67c58ec-ea10-48df-be09-2c7ba182203c
md"""
**Interactive Value**
 
- Present-value quantity of carbon class sold to the AAM ``\Delta \bar C_i =`` $(@bind ΔC̄ᵢ_input Scrubbable([0.001; 0.01; 0.05:0.05:1], default=1, format=".1%"))
"""

# ╔═╡ 8e183809-01d7-45ad-ab2b-035e111bda9f
md"Figure 9: ``A`` Price Curves (``\Delta A``) when ``\Delta \bar C_i =`` $(100 * ΔC̄ᵢ_input) %"

# ╔═╡ bdf72e02-a3d3-4163-98ad-163949c57b31
begin
    Aᵢ_values = 0.0:0.1:1.0
    Gᵢ_values = 0.0:0.1:1.0
    ΔA_points = [ΔA_sale(Aᵢ, Gᵢ, ΔC̄ᵢ_input) for Gᵢ in Gᵢ_values, Aᵢ in Aᵢ_values]
    ΔA_points[:, 1] .= NaN
    Plots.heatmap(
        Aᵢ_values,
        Gᵢ_values,
        ΔA_points,
        title="Heatmap of ΔA with ΔC̄ᵢ = $(round(Int, 100 * ΔC̄ᵢ_input)) %",
        xlabel="Aᵢ",
        ylabel="Gᵢ",
        xticks=Aᵢ_values,
        yticks=Gᵢ_values,
        yflip=true,
        grid=false,
        tick_direction=false,
        colormap=:Spectral,
    )
    ΔA_annotations = round.(vec(ΔA_points); digits = 2)
    annotate!(
        vec(last.(Iterators.product(Gᵢ_values, Aᵢ_values))),
        vec(first.(Iterators.product(Gᵢ_values, Aᵢ_values))),
        [(isnan(ann) ? "" : string(ann), 8) for ann in ΔA_annotations],
    )
end

# ╔═╡ 926fe910-8a82-4f89-9d67-425d7c26fd12
md"Figure 10: Normalized ``A`` Price Curves (``\Delta A``) when ``\Delta \bar C_i =`` $(100 * ΔC̄ᵢ_input) %"

# ╔═╡ 87b0af4c-8f57-48d7-9f3e-678726587208
begin
    ΔA_norm = [ΔA_sale(Aᵢ, Gᵢ, ΔC̄ᵢ_input) / Aᵢ for Gᵢ in Gᵢ_values, Aᵢ in Aᵢ_values]
    Plots.heatmap(
        Aᵢ_values,
        Gᵢ_values,
        ΔA_norm,
        title="Normalized Map of ΔA with ΔC̄ᵢ = $(round(Int, 100 * ΔC̄ᵢ_input)) %",
        xlabel="Aᵢ",
        ylabel="Gᵢ",
        xticks=Aᵢ_values,
        yticks=Gᵢ_values,
        yflip=true,
        grid=false,
        tick_direction=false,
        colormap=:Spectral,
    )
    ΔA_norm_annotations = round.(vec(ΔA_norm); digits = 2)
    annotate!(
        vec(last.(Iterators.product(Gᵢ_values, Aᵢ_values))),
        vec(first.(Iterators.product(Gᵢ_values, Aᵢ_values))),
        [(isnan(ann) ? "" : string(ann), 8) for ann in ΔA_norm_annotations],
    )
end

# ╔═╡ 931f8f34-824a-42bb-8498-61718fe74eba
md"""
Noting that the sensitivity to ``G`` increases as ``A`` increases and the effects become more pronounced as ``\Delta \bar C_i`` increases.

Examples can be seen in Apppendix B.
"""

# ╔═╡ 4e42f39f-f8a6-4ba7-9bd6-f57d4a7e5c6f
md"""
#### 6.1.2 Zero Carbon scenario

There is the circumstance when there is zero Carbon held in the portfolio for a particular class, i.e. ``C_i = 0`` which invalidates the calculation of ``\Delta \bar C_i``. This is dealt with by computing an _implied_ portfolio balance ``\tilde C_i``.

Defining ``\bar C_j`` as the Carbon balances under Equation (15) for the whole portfolio of ``J`` Carbon classes with strictly positive Carbon balances and ``A_j`` as the respective price stakes expressed as the proportion of outstanding ``A`` tokens; and with ``C_\emptyset`` as any Carbon class with a zero Carbon balances with a strictly positive ``A`` price stake.

The implied balance for any zero carbon asset is given as:
"""

# ╔═╡ c2c3f35d-46db-458e-a3e8-3e37a58d38bd
texeq"\tilde C_\emptyset = \left( \prod_{j=1}^J \bar C_j^{A_j} \right)^{1 / \sum_1^J A_j}"

# ╔═╡ c32a9a47-6cbf-48d9-b072-9b8d420e4737
md"""
Hence ``\tilde C_\emptyset`` can be substituted in Equation (16) for ``\bar C_i`` and the process can compute.
"""

# ╔═╡ 88ffde02-9ef0-43af-be24-021bb095c2ff
md"""
**Interactive Values**

- Number of present-value tonnes of carbon class 1 held in the AAM ``\bar C_1 =`` $(@bind C̄₁ Scrubbable(Int.(round.(exp10.(0.0:0.4:10); sigdigits=1)), default=20_000_000)) tonnes

- Number of present-value tonnes of carbon class 2 held in the AAM ``\bar C_2 =`` $(@bind C̄₂ Scrubbable(Int.(round.(exp10.(0.0:0.4:10); sigdigits=1)), default=200_000)) tonnes

- Number of present-value tonnes of carbon class 3 held in the AAM ``\bar C_3 =`` $(@bind C̄₃ Scrubbable(Int.(round.(exp10.(0.0:0.4:10); sigdigits=1)), default=2000)) tonnes

- ``A`` tokens staked for pricing carbon class 1 ``A_1 =`` $(@bind A₁ Scrubbable(0:0.05:0.30, default=0.1, format=".0%"))

- ``A`` tokens staked for pricing carbon class 2 ``A_2 =`` $(@bind A₂ Scrubbable(0:0.05:0.30, default=0.1, format=".0%"))

- ``A`` tokens staked for pricing carbon class 3 ``A_3 =`` $(@bind A₃ Scrubbable(0:0.05:0.30, default=0.1, format=".0%"))
"""

# ╔═╡ 41f6a7a3-0472-4e59-ac4b-1de4dd9ea1f2
"Vector of the strictly positive carbon balances of carbon classes held in the AAM"
C̄⃗ = [C̄₁; C̄₂; C̄₃]

# ╔═╡ d70c0e42-ab0b-46e4-855a-400c49ce2c8e
"Vector of the total ``A`` tokens staked for pricing each carbon class with a strictly positive carbon balance held in the AAM"
A⃗ = [A₁; A₂; A₃]

# ╔═╡ 8f49d85a-1181-403f-bf04-dbcb04973b9e
"""
Implied balance for any zero-carbon class: geometric mean of the strictly positive present-value carbon balances currently held in the AAM weighted by their respective ``A`` token price stakes

``\\tilde C_\\emptyset = \\prod_{j=1}^J \\bar C_j^{A_j / \\sum_{k=1}^J A_k}``
"""
C̃∅ = prod(splat(^), zip(C̄⃗, A⃗/sum(A⃗)))

# ╔═╡ 49240b8b-66c6-49cd-8873-e4b6ccd684bf
begin
    plt_implied_balance = plot(
        eachindex(C̄⃗),
        C̄⃗,
        title="Implied Balance of Zero-Carbon Classes",
        ylabel="Carbon (Tonnes)",
        label="Present-Value Carbon Balances",
        color=6,
        seriestype=:bar,
        xticks=eachindex(C̄⃗),
        yticks=exp10.(0:10),
        xlimits=(firstindex(C̄⃗)-0.55, lastindex(C̄⃗)+0.55),
        ylimits=(exp10(floor(log10(minimum(C̄⃗))-0.01)+0.01), exp10(1.05 * log10(maximum(C̄⃗)))),
        yaxis=:log,
        legend=:outertopright,
    )
    plot!(
        [C̃∅],
        label="Implied Balance C̃∅ = $(round(Int, C̃∅)) Tonnes",
        color=7,
        seriestype=:hline,
    )
    plt_a_stakes = plot(
        eachindex(A⃗),
        100 * A⃗,
        xlabel="Carbon Class",
        ylabel="A Price Stake (%)",
        label="A Token Price Stakes",
        color=8,
        markershape=:circle,
        xticks=eachindex(A⃗),
        xlimits=(firstindex(A⃗)-0.55, lastindex(A⃗)+0.55),
        ylimits=(0, 110 * maximum(A⃗)),
    )
    plot(
        plt_implied_balance,
        plt_a_stakes;
        layout=(2,1),
        legend=:outertopright,
    )
end

# ╔═╡ 87268434-9ee6-41f4-97a5-f52fddf6f97e
md"""
**Interactive Value**

- Number of present-value tonnes of carbon class ``i`` sold to the AAM ``\Delta \bar C_{i\text{-tonnes}} =`` $(@bind ΔC̄ᵢ₋ₜₒₙₙₑₛ_sale Scrubbable(Int.(round.(exp10.(0.0:0.4:8); sigdigits=1)), default=600)) tonnes

- Current price of one ``A`` token ``A_\text{pri} =`` $(@bind Aₚᵣᵢ_sale Scrubbable(0.1:0.1:1.0, default=0.5)) USD

- Total supply of ``A`` tokens ``A_\text{tokens} =`` $(@bind Aₜₒₖₑₙₛ_sale Scrubbable(Int.(round.(exp10.(0.0:0.4:8); sigdigits=1)), default=20_000_000)) tokens

- Total ``A`` tokens staked for pricing carbon class ``i``, ``A_i =`` $(@bind Aᵢ_sale Scrubbable([0; 0.001; 0.01; 0.05:0.05:1], default=0.05, format=".1%"))

- Total ``G`` tokens staked for pricing carbon class ``i``, ``G_i =`` $(@bind Gᵢ_sale Scrubbable([0; 0.001; 0.01; 0.05:0.05:1], default=0.05, format=".1%"))
"""

# ╔═╡ 44338154-89a0-40e5-ad9c-4f9bc268c3b0
"""
Number of ``A`` tokens issued by the AAM to pay for carbon

``\\Delta A_\\text{tokens} = \\Delta A(A_i, G_i, \\Delta \\bar C_i) \\, A_\\text{tokens}``
"""
ΔAₜₒₖₑₙₛ_sale = ΔA_sale(Aᵢ_sale, Gᵢ_sale, ΔC̄ᵢ_sale) * Aₜₒₖₑₙₛ_sale

# ╔═╡ 740136d7-dfd5-4b7f-af94-8b1928809eaa
"Price of one tonne of carbon class ``i`` sold to the AAM ``C_{i\\text{-pri}} = \\frac{\\Delta A_\\text{tokens} \\, A_\\text{pri}}{\\Delta \\bar C_\\text{i{-tonnes}}}``"
Cᵢ₋ₚᵣᵢ_sale = ΔAₜₒₖₑₙₛ_sale * Aₚᵣᵢ_sale / ΔC̄ᵢ₋ₜₒₙₙₑₛ_sale

# ╔═╡ 2dd0fbbb-0b3b-48e6-85ce-8285a0ab6a23
if iszero(Aᵢ_sale)
    md"""
    **Interactive Result**

    | ``A_i`` | ``\Delta \bar C_{i\text{-tonnes}}`` | ``\Delta A_\text{tokens}`` | ``C_{i\text{-pri}}`` |
    |:-------:|:-----------------------------------:|:--------------------------:|:--------------------:|
    | 0       | 0                                   | 0.0                        | N/A                  |

    - Zero ``A`` tokens are staked for pricing carbon class ``i``.

    - It is not possible to sell any carbon from this class to the AAM.
    """
else
    let
        ΔC̄ᵢ₋ₜₒₙₙₑₛ = round(Int, ΔC̄ᵢ₋ₜₒₙₙₑₛ_sale)
        ΔAₜₒₖₑₙₛ = round(ΔAₜₒₖₑₙₛ_sale; sigdigits=2)
        Cᵢ₋ₚᵣᵢ = round(Cᵢ₋ₚᵣᵢ_sale; sigdigits=3)

        md"""
        **Interactive Result**

        | ``A_i`` | ``\Delta \bar C_{i\text{-tonnes}}`` | ``\Delta A_\text{tokens}`` | ``C_{i\text{-pri}}`` |
        |:-------:|:-----------------------------------:|:--------------------------:|:--------------------:|
        | 0       | $ΔC̄ᵢ₋ₜₒₙₙₑₛ                         | $ΔAₜₒₖₑₙₛ                  | $Cᵢ₋ₚᵣᵢ              |

        - Selling $ΔC̄ᵢ₋ₜₒₙₙₑₛ present-value tonnes of carbon class ``i`` to the AAM results in the issuance of around $ΔAₜₒₖₑₙₛ ``A`` tokens.

        - The AAM gives carbon class ``i`` a price of around $Cᵢ₋ₚᵣᵢ USD per tonne.
        """
    end
end

# ╔═╡ 4f1f6dd8-9123-4569-95d6-5a5cd2858453
md"""
### 6.2 Carbon Retirement (AAM Sells)

#### 6.2.1 Weighted Carbon Class

For retiring Carbon that is _weighted_, that is there is a strictly positive ``A`` token stake for that class, an ``A`` token holder can extract the Carbon class offset of their choice ``C_i`` but the available pool is only the liquid balance, namely the element ``C_{i0}``
"""

# ╔═╡ 8b39f6aa-18c8-46b5-92fd-a7c4506161fe
texeq"\ln(1 + \Delta C_i) = \frac{\ln(1 - \Delta A)}{A_i + \frac 1 2 A_i^2(1 - G_i)^2} \quad \Delta A \neq 1"

# ╔═╡ 6bc69402-a3ec-4017-9cd7-a6a8b3fa201f
md"""
As before denoting the expression on the right hand side of Equation (20) as ``\mathsf{RHS}``:
"""

# ╔═╡ 699e4566-d8ee-4a40-821e-722f6bf648e5
texeq"\Delta C_i = \exp(\mathsf{RHS}) - 1"

# ╔═╡ 78ae6c96-3a20-4813-8bce-c729b1f82f51
"""
Liquid quantity of carbon class ``i`` to be retired

``\\Delta C_i(A_i, G_i, \\Delta A) = \\exp\\left( \\frac{\\ln(1 - \\Delta A)}{A_i + \\frac 1 2 A_i^2(1 - G_i)^2} \\right) - 1``
"""
ΔCᵢ_ret(Aᵢ, Gᵢ, ΔA) = exp(log(1 - ΔA)/(Aᵢ + Aᵢ^2 * (1 - Gᵢ)^2 / 2)) - 1

# ╔═╡ 980eaea1-36d6-491f-89ef-814e63b8c711
md"""
**Interactive Value**

- Tokens placed in the 'burn' mecanism for Carbon offsets ``\Delta A =`` $(@bind ΔA_input Scrubbable([0.001; 0.01; 0.05:0.05:1], default=0.1, format=".1%"))
"""

# ╔═╡ 01908f22-8d04-4644-bc55-72abe33568f0
md"Figure 11: Proportion of Carbon Retired when ``\Delta A =`` $(100 * ΔA_input) %"

# ╔═╡ 460c0b10-3cd4-4e76-8c60-702eb489cf71
begin
    ΔC_points = [ΔCᵢ_ret(Aᵢ, Gᵢ, ΔA_input) for Gᵢ in Gᵢ_values, Aᵢ in Aᵢ_values]
    ΔC_points[:, 1] .= NaN
    Plots.heatmap(
        Aᵢ_values,
        Gᵢ_values,
        -ΔC_points,
        title="Heatmap of -ΔC with ΔA = $(round(Int, 100 * ΔA_input)) %",
        xlabel="Aᵢ",
        ylabel="Gᵢ",
        xticks=Aᵢ_values,
        yticks=Gᵢ_values,
        yflip=true,
        grid=false,
        tick_direction=false,
        colormap=:Spectral,
    )
    ΔC_annotations = round.(vec(-ΔC_points); digits = 2)
    annotate!(
        vec(last.(Iterators.product(Gᵢ_values, Aᵢ_values))),
        vec(first.(Iterators.product(Gᵢ_values, Aᵢ_values))),
        [(isnan(ann) ? "" : string(ann), 8) for ann in ΔC_annotations],
    )
end

