# ╔═╡ aa5505fb-a6bf-4ba5-b6e9-40455e26517b
md"""
#### 6.2.2 Unweighted Carbon Class

When a Carbon class is included in the portfolio but currently has no weighting (``A_i = 0``) some modifications are required. An important distinction is the retirement of zero-weighted Carbon is as a portfolio and not for specified Carbon classes. The ``A`` token burnt will receive a portion of the underlying residual
portfolio weighted by tons of liquid Carbon.

Assuming ``A \neq 1``:

``A_i`` is replaced in Equation (20) for the residual portfolio of unweighted Carbon, ``C_\emptyset``, with an implied weighting ``\tilde A_\emptyset`` derived from the total liquid Carbon assets
"""

# ╔═╡ 322a437f-30c1-4a37-9314-ece7e51f00a6
texeq"\tilde A_\emptyset = (1 - A)^2"

# ╔═╡ 935b6ba0-4e18-4b62-9c57-ac13c33a8466
md"With ``K`` classes of Carbon existing in the residual portfolio, noting that ``C_{\emptyset 0} = \sum_{k=1}^K C_{k0}``, with ``G_k`` similarly defined, we can determine an average for ``G_\emptyset``:"

# ╔═╡ 987517e3-bd2e-4e7f-ad40-99469150318a
texeq"G_\emptyset = \frac{1}{C_{\emptyset 0}} \sum_{k=1}^K G_k C_{k0}"

# ╔═╡ f4360d49-932c-4b03-9a30-025201bdae66
md"""
Substituting in Equation (20)
"""

# ╔═╡ 122a9ef9-3eb1-4744-9e04-470bc3992b85
texeq"\ln(1 + \Delta C_\emptyset) = \frac{\ln(1 - \Delta A)}{\tilde A_\emptyset + \frac 1 2 \tilde A_\emptyset^2 (1 - G_\emptyset)^2} \quad \Delta A \neq 1"

# ╔═╡ ece7e1fb-a1de-4f68-9144-4bb423a259be
md"The result ``\Delta C_\emptyset`` is applied to the liquid elements of the residual portfolio to determine the delivery quantities."

# ╔═╡ 35a499ec-8731-4b5d-afa2-7b9b2fbcfdfd
md"""
**Interactive Values**

- ``G`` tokens staked for pricing carbon class 1 ``G_1 =`` $(@bind G₁ Scrubbable(0:0.05:0.30, default=0.3, format=".0%"))

- ``G`` tokens staked for pricing carbon class 2 ``G_2 =`` $(@bind G₂ Scrubbable(0:0.05:0.30, default=0.2, format=".0%"))

- ``G`` tokens staked for pricing carbon class 3 ``G_3 =`` $(@bind G₃ Scrubbable(0:0.05:0.30, default=0.1, format=".0%"))

- Number of liquid tonnes of carbon class 1 held in the AAM ``C_{1 \, 0} =`` $(@bind C₁₋₀ Scrubbable(0:0.05:0.30, default=0.1, format=".0%"))

- Number of liquid tonnes of carbon class 2 held in the AAM ``C_{2 \, 0} =`` $(@bind C₂₋₀ Scrubbable(0:0.05:0.30, default=0.1, format=".0%"))

- Number of liquid tonnes of carbon class 3 held in the AAM ``C_{3 \, 0} =`` $(@bind C₃₋₀ Scrubbable(0:0.05:0.30, default=0.2, format=".0%"))
"""

# ╔═╡ c2c2cc58-7651-4b1a-8556-8f73a14901df
"Liquid carbon balances held in the AAM from carbon classes with strictly positive ``A`` stakes"
C⃗₀ = [C₁₋₀; C₂₋₀; C₃₋₀]

# ╔═╡ db03708a-5c1b-489d-986e-6ce62afe2108
"Total quantity of liquid carbon held in the AAM from carbon classes with strictly positive ``A`` stakes"
C∅₀ = sum(C⃗₀)

# ╔═╡ b1e2cc16-7e78-462d-8cf4-626c23f38c06
"Total ``G`` tokens staked for pricing each carbon class with a strictly positive ``A`` stake"
G⃗ = [G₁; G₂; G₃]

# ╔═╡ 7a68be70-477a-47b3-b0d2-b7fb249cc9a6
"""
Implied stake of ``G`` tokens for carbon classes with zero ``A`` stake, defined as the mean ``G`` stake of carbon classes with strictly positive ``A`` stakes (the residual portfolio) weighted by their liquid carbon balances

``G_\\emptyset = \\operatorname{mean}_{\\vec C_0} (\\vec G) = \\frac{\\vec C_0 \\cdot \\vec G}{C_{\\emptyset 0}}``
"""
G∅ = C⃗₀' * G⃗ / C∅₀

# ╔═╡ 9ebc352a-91d7-4a95-8586-78ef98996448
begin
    plt_g_stakes = plot(
        eachindex(G⃗),
        100 * G⃗,
        title="Implied G Stake of Carbon Classes with Aₖ = 0 %",
        ylabel="Stake (%)",
        label="G Token Stakes",
        color=12,
        markershape=:circle,
        xticks=eachindex(G⃗),
        xlimits=(firstindex(G⃗)-0.55, lastindex(G⃗)+0.55),
        ylimits=(0, 110 * maximum(G⃗)),
    )
    plot!(
        [100 * G∅],
        label="Implied Stake G∅ = $(round(Int, 100 * G∅)) %",
        color=10,
        seriestype=:hline,
    )
    plt_implied_g_staking = plot(
        eachindex(C⃗₀),
        100 * C⃗₀,
        xlabel="Carbon Class",
        ylabel="Carbon Balance (%)",
        label="Liquid Carbon Balances",
        color=11,
        seriestype=:bar,
        xticks=eachindex(C⃗₀),
        xlimits=(firstindex(C⃗₀)-0.55, lastindex(C⃗₀)+0.55),
        ylimits=(0, 110 * maximum(C⃗₀)),
        legend=:outertopright,
    )
    plot(
        plt_g_stakes,
        plt_implied_g_staking;
        layout=(2,1),
        legend=:outertopright,
    )
end

# ╔═╡ e150a5bc-a30b-4e32-a601-39658a156e80
md"""
If ``A = 1:``

In the event that there is 100% ``A`` staking for price, and the portfolio consists of zero-staked Carbon classes with liquid balances, the portfolio begins to issue these balances __to all A Bond holders__ as a daily liquid yield using the governance-based weightings ``V`` in Section 5, Equation (13).

With ``S`` as previously defined as the total ``A`` tokens staked as bonds (Time staking):
"""

# ╔═╡ 7d8853f5-637e-4f97-a312-4272bfaa8464
texeq"\Delta C_\emptyset = \frac{1}{365} \, \frac{S}{1 - \frac 1 2 (1 - G_\emptyset)^2}"

# ╔═╡ cb822428-cad5-4818-9566-a0b6236a9402
md"""
#### 6.2.3 Liqidation: ``\Delta A = 1``

In the event that 100% of ``A`` tokens are placed into the burn mechanism for Carbon offsets, the following occurs:

- The portfolio of liquid tokens is distributed to the ``A`` token sellers pro-rata to ``A`` contribution

- A new set of nominal ``A`` tokens are issued to locked ``G`` token holders on a pro-rata basis
"""

# ╔═╡ 8c898830-f2b5-452e-a427-92b3e2294c09
"Spread ``\\varepsilon(A_i, G_i, \\Delta C) = (\\Delta C + \\Delta C_i(A_i, G_i, \\Delta A(A_i, G_i, \\Delta C))) / \\Delta C``."
ε(Aᵢ, Gᵢ, ΔC) = (ΔC + ΔCᵢ_ret(Aᵢ, Gᵢ, ΔA_sale(Aᵢ, Gᵢ, ΔC))) / ΔC

