# ╔═╡ a24d0a97-2c2a-4452-aa0d-c5326e632f75
md"""
**Interactive Values**

- Liquid quantity of carbon class ``i`` held in the AAM ``C_{i0} =`` $(@bind Cᵢ₀_ret Scrubbable([0; 0.001; 0.01; 0.05:0.05:1], default=0.5, format=".1%"))

- Number of tonnes of carbon class ``i`` held in the AAM ``C_i =`` $(@bind Cᵢ_ret Scrubbable(Int.(round.(exp10.(0.0:0.4:8); sigdigits=1)), default=1_000_000)) tonnes

- Current price of one ``A`` token ``A_\text{pri} =`` $(@bind Aₚᵣᵢ_ret Scrubbable(0.1:0.1:1.0, default=0.5)) USD

- Amount of ``A`` tokens burned by the AAM to retire carbon ``\Delta A``: $(@bind ΔA_ret Scrubbable(round.(exp10.(-5:0.5:0); sigdigits=1), default=0.00001, format=".3%"))

- Total supply of ``A`` tokens ``A_\text{tokens} =`` $(@bind Aₜₒₖₑₙₛ_ret Scrubbable(Int.(round.(exp10.(0.0:0.4:8); sigdigits=1)), default=20_000_000)) tokens

- Total ``A`` tokens staked for pricing carbon class ``i``, ``A_i =`` $(@bind Aᵢ_ret Scrubbable([0; 0.001; 0.01; 0.05:0.05:0.95; 0.99; 0.999; 1], default=0.05, format=".1%"))

- Total ``G`` tokens staked for pricing carbon class ``i``, ``G_i =`` $(@bind Gᵢ_ret Scrubbable([0; 0.001; 0.01; 0.05:0.05:0.95; 0.99; 0.999; 1], default=0.05, format=".1%"))

- (When ``A_i = 0 \, \%``) Total ``A`` tokens staked for pricing ``A =`` $(@bind A_ret Scrubbable([0; 0.001; 0.01; 0.05:0.05:0.95; 0.99; 0.999; 1], default=0.5, format=".1%"))

- (When ``A_i = 0 \, \%`` and ``A = 100 \, \%``) Total ``A`` tokens staked for bonds ``S =`` $(@bind S_ret Scrubbable([0; 0.001; 0.01; 0.05:0.05:0.95; 0.99; 0.999; 1], default=0.5, format=".1%"))
"""

# ╔═╡ ee763f1f-3ef5-4544-868f-6e7c1c6b4003
"""
Implied stake of ``A`` tokens for carbon classes with zero ``A`` stake defined as the square of the ``A`` tokens that are not staked for pricing

``\\tilde A_\\emptyset = (1 - A)^2``
"""
Ã∅ = (1 - A_ret)^2

# ╔═╡ eaf26d6d-7816-4809-84fb-e83b607f1299
"""
Daily liquid carbon yield of carbon classes with zero ``A`` tokens staked for price when 100 % of ``A`` tokens are staked for price ``\\Delta C_\\emptyset = \\frac{S}{365 \\left( 1 - \\frac 1 2 (1 - G_\\emptyset)^2 \\right)}``.
"""
ΔC∅ = S_ret / (365 * (1 - (1-G∅)^2 / 2))

# ╔═╡ 9fd81eee-2650-4775-aeac-fe08819861b3
"Number of ``A`` tokens burned by the AAM to retire carbon ``\\Delta A_\\text{tokens} = \\Delta A \\, A_\\text{tokens}``"
ΔAₜₒₖₑₙₛ_ret = ΔA_ret * Aₜₒₖₑₙₛ_ret

# ╔═╡ d9f9a648-fb9f-4b6f-9b69-dfbd8844054f
"Number of liquid tonnes of carbon class ``i`` held in the AAM ``C_{i0\\text{-tonnes}} = C_{i0} \\, C_i``"
Cᵢ₀₋ₜₒₙₙₑₛ_ret = Cᵢ₀_ret * Cᵢ_ret

# ╔═╡ 766123f0-a033-4db9-850b-952c93fd151e
"Number of liquid tonnes of carbon class ``i`` to be retired ``\\Delta C_{i\\text{-tonnes}} = \\Delta C_i \\, C_{i0\\text{-tonnes}}``"
ΔCᵢ₋ₜₒₙₙₑₛ_ret = (iszero(Aᵢ_ret) ? ΔCᵢ_ret(Ã∅, G∅, ΔA_ret) : ΔCᵢ_ret(Aᵢ_ret, Gᵢ_ret, ΔA_ret)) * Cᵢ₀₋ₜₒₙₙₑₛ_ret

# ╔═╡ 227ef9d7-01d8-4c30-a96b-d03075145af5
"Price of one retired tonne of carbon class ``i``, ``C_{i\\text{-pri}} = \\frac{\\Delta A_\\text{tokens} \\, A_\\text{pri}}{-\\Delta C_\\text{i{-tonnes}}}``"
Cᵢ₋ₚᵣᵢ_ret = ΔAₜₒₖₑₙₛ_ret * Aₚᵣᵢ_ret / -ΔCᵢ₋ₜₒₙₙₑₛ_ret

# ╔═╡ 01cb011e-c72c-4214-b3ad-f0da2d5b3e3d
let
    Ã∅_ = round(Ã∅; sigdigits=2)
    ΔAₜₒₖₑₙₛ = round(Int, ΔAₜₒₖₑₙₛ_ret)
    ΔCᵢ₋ₜₒₙₙₑₛ = round(Int, ΔCᵢ₋ₜₒₙₙₑₛ_ret)
    ΔC∅_ = round(ΔC∅; sigdigits=2)
    Cᵢ₋ₚᵣᵢ = round(Cᵢ₋ₚᵣᵢ_ret; sigdigits=3)

    if !iszero(Aᵢ_ret)
        md"""
        **Interactive Result**

        | ``A_i``  | ``\Delta A_\text{tokens}`` | ``\Delta C_{i\text{-tonnes}}`` | ``C_{i\text{-pri}}`` |
        |:--------:|:--------------------------:|:------------------------------:|:--------------------:|
        | $Aᵢ_ret  | $ΔAₜₒₖₑₙₛ                  | $ΔCᵢ₋ₜₒₙₙₑₛ                    | $Cᵢ₋ₚᵣᵢ              |

        - Burning $ΔAₜₒₖₑₙₛ tokens results in the retirement of around $(-ΔCᵢ₋ₜₒₙₙₑₛ) tonnes of carbon class ``i``.

        - The AAM gives carbon class ``i`` a price of around $Cᵢ₋ₚᵣᵢ USD per tonne.
        """
    elseif !isone(A_ret)
        md"""
        **Interactive Result**

        | ``A``  | ``\tilde A_\emptyset`` | ``\Delta A_\text{tokens}`` | ``\Delta C_{i\text{-tonnes}}`` | ``C_{i\text{-pri}}`` |
        |:------:|:----------------------:|:--------------------------:|:------------------------------:|:--------------------:|
        | $A_ret | $Ã∅_                   | $ΔAₜₒₖₑₙₛ                  | $ΔCᵢ₋ₜₒₙₙₑₛ                    | $Cᵢ₋ₚᵣᵢ              |

        - Burning $ΔAₜₒₖₑₙₛ tokens results in the retirement of around $(-ΔCᵢ₋ₜₒₙₙₑₛ) tonnes of carbon class ``i``.

        - The AAM gives carbon class ``i`` a price of around $Cᵢ₋ₚᵣᵢ USD per tonne.
        """
    else
        md"""
        **Interactive Result**

        | ``S``  | ``A``  | ``\tilde A_\emptyset`` | ``\Delta A_\text{tokens}`` | ``\Delta C_{i\text{-tonnes}}`` | ``\Delta C_\emptyset`` | ``C_{i\text{-pri}}`` |
        |:------:|:------:|:----------------------:|:--------------------------:|:------------------------------:|:----------------------:|:--------------------:|
        | $S_ret | $A_ret | $Ã∅_                   | $ΔAₜₒₖₑₙₛ                  | $ΔCᵢ₋ₜₒₙₙₑₛ                    | $ΔC∅_                  | $Cᵢ₋ₚᵣᵢ              |

        - Burning $ΔAₜₒₖₑₙₛ tokens results in the retirement of around $(-ΔCᵢ₋ₜₒₙₙₑₛ) tonnes of carbon class ``i``.

        - The AAM gives carbon class ``i`` a price of around $Cᵢ₋ₚᵣᵢ USD per tonne.

        - The AAM issues $ΔC∅_ tonnes of carbon class ``i`` to all ``A`` bond holders as a daily liquid yield
        """
