# ╔═╡ 1010f980-6f71-4e26-ad59-37c5741cb9e8
md"""
## 7 Liquidity

Both ``A`` and ``G`` tokens can be used independently of price (and time) staking for providing liquidity.
"""

# ╔═╡ e56d5c2a-8b9e-412f-b5ef-7b270319c160
md"""
Figure 14: Token Liquidity and Pricing Structure

![Token Liquidity and Pricing Structure](data:image/png;base64,)
"""

# ╔═╡ 1025a73d-7bfd-47f7-b5e7-c5cac805a9df
md"""
There are two core liquidity pools:

1. An AMM 50:50 pairing of ``A`` and ``G`` tokens; pool ``\overline{AG}``.

2. A hard currency USDC denoted as ``Q`` paired with ``A``; pool ``\overline{AQ}``.
"""

# ╔═╡ 84ef05b6-a093-4003-9f84-65ad4998bdae
md"""
### 7.1 Liquidity Fees

The ``\overline{AQ}`` pool will have its own set of fees in the normal way. [^1]

The ``\overline{AG}`` pool has different economics as the assets are highly correlated since they represent the same economy. For this reason, the fees are extremely low.

By locking liquidity (LP tokens) to the **standard maturities**, both pools may receive a distribution of ``A`` tokens determined from the Risky Yield calculation below. This is an __additional__ primary issuance to the Bond yields already discussed.

[^1]: Note the development of LP pricing functionality may be applicable
"""

# ╔═╡ 4188d90c-62bf-4103-b2e1-e9f42e6788c6
md"""
## 8 Risky Yield

### 8.1 Beta Determination

We can consider the Bond market yield as the system _risk-free_ rate. In addition to this mechanism, a _risky_ spread is determined that is ultimately paid to the liquidity providers of the ``A`` and ``G`` tokens as compensation for the risk levels assumed.

As we have seen, the ``G`` token has an impact on risk-pricing of ``A``. As ``G`` staking increases, the relationship between the Carbon class selected under ``G_i`` and the portfolio token ``A`` strengthens. We can consider ``G_i`` staking as an estimate of residual or idiosyncratic risk in the carbon-class and this allows us to calculate a portfolio beta ``\beta`` from the implied betas of each carbon class ``i``.
"""

# ╔═╡ 9ba89969-cec7-490b-b895-f76c92a01fbc
texeq"\beta = \sqrt{\sum_{i=1}^n A_i - A_i (1 - G_i)^2}"

# ╔═╡ ef643941-e0a7-41b1-a919-4d62b2c80f4d
md"""
The portfolio ``\beta`` determines a yield factor for the liquidity pools of A to compensate for the implied risk levels.

For intuition, the map in Figure 15 shows the various outputs of the function per Class.
"""

# ╔═╡ 35f84511-fa19-42a1-8b35-d78d61a52d0f
"Carbon class ``i`` portfolio ``\\beta_i(A_i, G_i) = \\sqrt{A_i - A_i (1 - G_i)^2}``"
βᵢ(Aᵢ, Gᵢ) = √(Aᵢ - Aᵢ * (1 - Gᵢ)^2)

# ╔═╡ 6458df41-7170-4835-9525-75e5fb0d47ba
md"Figure 15: Range of ``\beta_i``"

# ╔═╡ 65507788-21da-4e73-a7f2-9ace9ce850ad
begin
    βᵢ_points = [βᵢ(Aᵢ, Gᵢ) for Gᵢ in Gᵢ_values, Aᵢ in Aᵢ_values]
    βᵢ_points[:, 1] .= NaN
    Plots.heatmap(
        Aᵢ_values,
        Gᵢ_values,
        βᵢ_points,
        title="Heatmap of Class βᵢ",
        xlabel="Aᵢ",
        ylabel="Gᵢ",
        xticks=Aᵢ_values,
        yticks=Gᵢ_values,
        yflip=true,
        grid=false,
        tick_direction=false,
        colormap=:Spectral,
    )
    βᵢ_annotations = round.(vec(βᵢ_points); digits = 2)
    annotate!(
        vec(last.(Iterators.product(Gᵢ_values, Aᵢ_values))),
        vec(first.(Iterators.product(Gᵢ_values, Aᵢ_values))),
        [(isnan(ann) ? "" : string(ann), 8) for ann in βᵢ_annotations],
    )
end

