# ╔═╡ 476d8a3c-6531-464e-91b3-8d03d4398919
md"""
### 8.3 Share of Risky Premium

The risky premium allocation is shared between ``G`` staking, ``\overline{AG}`` and ``\overline{AQ}`` pools with shares ``\lambda_{GG}``, ``\lambda_G`` and ``\lambda_Q`` respectively.

Defining:

- ``G_G``: Total ``G`` tokens in the ``\overline{AG}`` pool, expressed as a proportion of outstanding supply of ``G``.

- ``A_G``: Total ``A`` tokens in the ``\overline{AG}`` pool, expressed as a proportion of outstanding supply of ``A``.

- ``A_Q``: Total ``A`` tokens in the ``\overline{AQ}`` pool, expressed as a proportion of outstanding supply of ``A``.

The allocation to ``G`` token staking, ``\lambda_{GG}``:
"""

# ╔═╡ 61f05ffb-cfd2-4228-8b4b-077042e093a3
texeq"\lambda_{GG} = \frac{1 - A_Q}{1 + \left( \frac{G_i}{G_G} \right)^2}"

# ╔═╡ 951f21fe-c7bd-40d0-bc9a-ad48d0569283
"Risky premuim allocation to ``G`` token staking ``\\lambda_{GG}(A_Q, G_i) = \\frac{1 - A_Q}{1 + \\left( \\frac{G_i}{1 - G_i} \\right)^2}``."
λ_GG(A_Q, Gᵢ) = (1 - A_Q) / (1 + (Gᵢ/(1 - Gᵢ))^2)

# ╔═╡ 7e2b914c-d28a-4308-8297-07385433ba46
md"Figure 18: G Stake Allocation (assuming ``G_G = 1 − G_i``)"

# ╔═╡ a78d1344-c464-440a-9797-cffce808fc7e
begin
    A_Q_values = 0.0:0.1:1.0
    λ_GG_points = [λ_GG(A_Q, Gᵢ) for Gᵢ in Gᵢ_values, A_Q in A_Q_values]
    Plots.heatmap(
        A_Q_values,
        Gᵢ_values,
        λ_GG_points,
        title="Heatmap of λ_GG with G_G = 1 - G",
        xlabel="A_Q",
        ylabel="G",
        xticks=A_Q_values,
        yticks=Gᵢ_values,
        yflip=true,
        grid=false,
        tick_direction=false,
        colormap=:Spectral,
    )
    λ_GG_annotations = round.(vec(λ_GG_points); digits = 2)
    annotate!(
        vec(last.(Iterators.product(Gᵢ_values, A_Q_values))),
        vec(first.(Iterators.product(Gᵢ_values, A_Q_values))),
        [(string(ann), 8) for ann in λ_GG_annotations],
    )
end

# ╔═╡ 00da42f3-0139-4dd1-8033-42d13594b96c
md"""
Noting the relationship between ``G`` and ``\beta``, and particularly if ``G = 0``, ``\beta = 0``.

The residual share, ``1 − λ_{GG}``, is split between the liquidity pools:
"""

# ╔═╡ 2e37a2fc-9cb7-47b8-bb38-2b21d562c512
texeq"\lambda_G = \frac{2 A_G}{2 A_G + A_Q \sqrt 2}"

# ╔═╡ 885de941-f640-40b2-83ad-0ba18ab61bf8
"Risky premuim allocation to the ``\\overline{AG}`` liquidity pool ``\\lambda_G(A_G, A_Q) = \\frac{2 A_G}{2 A_G + A_Q \\sqrt 2}``."
λ_G(A_G, A_Q) = (2 * A_G) / (2 * A_G + A_Q * √2)

# ╔═╡ 1bf0234e-69b3-418a-8803-e6e965f0c2d2
md"For completeness:"

# ╔═╡ d155ecee-1dfe-4157-83b1-9a38787cab3b
texeq"\lambda_Q = 1 - \lambda_G"

# ╔═╡ 77a22b1c-1193-4d21-83ba-e505a5d5364d
"Risky premuim allocation to the ``\\overline{AQ}`` liquidity pool ``\\lambda_Q(A_G, A_Q) = 1 - \\lambda_G(A_G, A_Q)``."
λ_Q(A_G, A_Q) = 1 - λ_G(A_G, A_Q)

# ╔═╡ 3ca7c00b-7966-4409-96fb-7ada461ed6c0
md"Figure 19: Liquidity Pool Split ``\lambda_G, \lambda_Q``"

# ╔═╡ f7044097-3304-4ece-9146-ae30372db379
begin
    A_G_values_fine = 0.0:0.005:1.0
    A_Q_values_fine = 0.0:0.005:1.0
    A_G_points = last.(Iterators.product(A_Q_values_fine, A_G_values_fine))
    A_Q_points = first.(Iterators.product(A_Q_values_fine, A_G_values_fine))
    λ_G_points = λ_G.(A_G_points, A_Q_points)
    λ_G_points[A_G_points .+ A_Q_points .> 1] .= NaN
    Plots.surface(
        A_G_points,
        A_Q_points,
        λ_G_points,
        title="Liquidity Share λ_G",
        xlabel="A_G",
        ylabel="A_Q",
        zlabel="λ_G",
        markersize=2,
        colormap=:Spectral,
        camera=(330, 28),
        guidefontsize=8,
        tickfontsize=8,
    )
end

# ╔═╡ 29229045-a8cf-4e78-bcbb-0f4bcba6aeb2
begin
    λ_Q_points = λ_Q.(A_G_points, A_Q_points)
    λ_Q_points[A_G_points .+ A_Q_points .> 1] .= NaN
    Plots.surface(
        A_G_points,
        A_Q_points,
        λ_Q_points,
        title="Liquidity Share λ_Q",
        xlabel="A_G",
        ylabel="A_Q",
        zlabel="λ_Q",
        colormap=:Spectral,
        camera=(330, 28),
        guidefontsize=8,
        tickfontsize=8,
    )
end

# ╔═╡ c31b49eb-c7ad-4487-95aa-0c66863d2647
md"""
### 8.4 Risky Premium Distribution

For ``\lambda_{GG}``, ``\lambda_G``, ``\lambda_Q`` we apply ``\beta``:
"""

# ╔═╡ 85b341e6-7ca0-4f2c-aa21-8cda9577fba1
texeq"\Lambda_X = \lambda_X \beta, \quad \text{for } X \in \{GG, G, Q\}"

# ╔═╡ e6510078-450f-46de-b7dd-c0683d69603e
md"Taking ``b`` as a discount parameter:"

# ╔═╡ 1d689db5-f822-4bab-8426-24e53a52331c
texeq"b = \frac{\sum_1^{40} Z_t S_t B_t}{\sum_1^{40} Z_t S_t }"

# ╔═╡ 6ca06202-2782-4a4e-b509-c14cc34043ea
md"The total Risky Yield tokens ``R_\lambda``:"

# ╔═╡ 145edbbc-ca76-4b82-a123-3d0b04ef19b3
texeq"R_\lambda = b \, R \, (\Lambda_3 + \Lambda_4 + \Lambda_5)"

# ╔═╡ f6f6362d-d4b6-4c4a-8488-4cbfb242725f
md"""
The allocations of ``R_\lambda`` are pro-rata to ``\Lambda_3``, ``\Lambda_4``, ``\Lambda_5`` and thereafter:

1. Locked ``G``: ``\Lambda_3`` in proportion to ``G``.

2. Locked ``\overline{AG}``, ``\overline{AQ}`` tokens are allocated a weighting ``G_t``, ``Q_t`` depending on their time bucket ``t``:
"""

# ╔═╡ affcc275-c85b-4a03-a077-c97bab646f03
texeq"G_t = \frac{Z_t L_{Gt} B_t}{\sum Z_t L_{Gt} B_t}"

# ╔═╡ 4b337b60-1510-4b49-ac27-538fc52eeb92
texeq"Q_t = \frac{Z_t L_{Qt} B_t}{\sum Z_t L_{Qt} B_t}"

# ╔═╡ e6ab2378-de86-4bc7-9f84-e80705975d6c
md"""
Where ``L_{Gt}``, ``L_{Qt}`` are the proportion of all liquidity locked in each time bucket for ``\overline{AG}`` and ``\overline{AQ}`` respectively.

Thereafter each time bucket allocation is proportionate to LP holdings.
"""

