# ╔═╡ 77544fe9-61a3-440d-a955-39f9e464c8c6
md"""
### 9.2 Programmatic Incentive Curve

The incentive issuance is built on a sigmoid curve, ``P``, to generate total proportion of supply in issue. It is calibrated from the initial issuance at TGE, ``P_0`` and the inflection point time ``T`` where 50% of ``G`` token incentives have been released.

Initiating ``x_0`` from the initial issuance parameter:
"""

# ╔═╡ 6e567d62-0d9d-4fef-8168-5e2ab102864d
texeq"x_0 = \ln\left( \frac{P_0}{1 - P_0} \right)"

# ╔═╡ b8df0b87-3d36-44fb-b2fe-419575112bdc
"Parameter ``x_0(P_0) = \\ln\\left( \\frac{P_0}{1 - P_0} \\right)``."
x₀(P₀) = log(P₀ / (1 - P₀))

# ╔═╡ 2a013b0f-dd5b-4739-9c75-f182b06d03b7
md"with ``x_t`` at time point ``t``, ``(t \in (0, \infty))``:"

# ╔═╡ 4c254e8f-dec6-4d5f-8642-be230504c8aa
texeq"x_t = x_0 \left( 1 - \frac t T \right)"

# ╔═╡ 6c7cf56a-cb18-4f81-be60-3365532dbca4
"'Life' span ``x_t(x_0, t, T) = x_0 \\left( 1 - \\frac t T \\right)``."
xₜ(x₀, t, T) = x₀ * (1 - t/T)

# ╔═╡ 6bfa6ac9-b127-48c3-9ef7-879bfdf4107e
md"Giving supply function ``P_t`` as:"

# ╔═╡ 215f4307-f5c4-4227-9a96-b869c7d41023
texeq"P_t = \frac{\exp(x_t)}{\exp(x_t) + 1}"

# ╔═╡ 4ab38f81-5a85-42f9-98da-9aad4555b753
"Supply function ``P_t(x_t) = \\frac{\\exp(x_t)}{\\exp(x_t) + 1} = \\frac{1}{\\exp(-x_t) + 1}``."
Pₜ(xₜ) = 1 / (exp(-xₜ) + 1)

# ╔═╡ af1ba0e7-d444-4bc4-aa1f-763ef31dccd3
"Rate of change of the supply function ``\\Delta_t P_t(x_0, x_t, T) = -\\frac{x_0 P_t(x_t)}{T (\\exp(x_t) + 1)}``."
ΔPₜ(x₀, xₜ, T) = -x₀ * Pₜ(xₜ) / (T * (exp(xₜ) + 1))

# ╔═╡ 0d907fe5-128a-4d47-b7d3-d349329f91ff
md"""
**Interactive Values**

- Initial issuance at TGE ``P_0 =`` $(@bind P₀_input Scrubbable(0.01:0.01:0.40, default=0.07, format=".0%"))

- Inflection point time ``T =`` $(@bind T_input Scrubbable(0.1:0.1:2, default=0.5))
"""

# ╔═╡ 514a132a-48c0-472b-9a99-ebcf805221a1
md"""
Setting ``P_0`` set at $(round(Int, 100 * P₀_input)) %:

Figure 21: Incentive Issuance
"""

# ╔═╡ f793b67e-7caa-4c2d-a7d5-56a3fc25534f
begin
    plot(
        0:0.01:1,
        t -> ΔPₜ(x₀(P₀_input), xₜ(x₀(P₀_input), t, T_input), T_input),
        title="Incentive Curve and Rate of Change",
        xlabel="'Life' Span",
        label="Rate of Change",
        fillalpha=0.5,
        fill=true,
        legend=:outertopright,
    )
    plot!(
        0:0.01:1,
        t -> Pₜ(xₜ(x₀(P₀_input), t, T_input)),
        label="Proportion of Supply",
        fillalpha=0.9,
        fill=true,
    )
end

