# ╔═╡ 0452198d-ad47-44d7-b767-0f5227b01db5
md"""
The **relative utilisation** measurement factor ``\upsilon`` is applied as follows:

Defining initially:

- ``G``: Total ``G`` tokens staked expressed as a proportion of circulating supply, ``G \in [0, 1]``.

- ``L``: Total ``G`` tokens held in the ``\overline{AG}`` pool expressed as a proportion of circulating supply, ``L \in (0, 1]``.

Where ``\upsilon = 0`` if ``G + L = 0`` otherwise:
"""

# ╔═╡ 577e9ae6-b182-4187-a13b-17d49dc450e0
texeq"\upsilon = \left( \frac{2 G L}{G^2 + L^2} \right)^2"

# ╔═╡ bea9043a-95eb-4fd7-8fe3-35eabe0c19c2
"Incentive parameter ``\\upsilon(G, L) = \\left( \\frac{2 G L}{G^2 + L^2} \\right)^2`` with ``\\upsilon(0, 0) = 0``."
υ(G, L) = (G == L == 0) ? 0 : (2 * G * L / (G^2 + L^2))^2

# ╔═╡ a7aeb6bb-550d-4db3-a69a-e8fcc31134f4
md"Figure 25: Upsilon ``\upsilon`` range of value"

# ╔═╡ 3615d420-9abf-405a-ab83-e850c6ba1352
begin
    G_values = 0.0:0.05:1.0
    L_values = 0.0:0.05:1.0
    G_points = last.(Iterators.product(L_values, G_values))
    L_points = first.(Iterators.product(L_values, G_values))
    υ_points = υ.(G_points, L_points)
    υ_points[G_points .+ L_points .> 1] .= NaN
    Plots.heatmap(
        G_values,
        L_values,
        υ_points,
        title="Range of υ",
        xlabel="L",
        ylabel="G",
        xticks=G_values[1:4:end],
        yticks=L_values[1:4:end],
        yflip=true,
        grid=false,
        tick_direction=false,
        colormap=:Spectral,
        colorbar=false,
    )
    υ_annotations = round.(vec(υ_points); digits = 2)
    annotate!(
        vec(last.(Iterators.product(G_values, L_values))),
        vec(first.(Iterators.product(G_values, L_values))),
        [(isnan(ann) ? "" : string(ann), 6) for ann in υ_annotations],
    )
end

# ╔═╡ da211c72-f3c0-435e-b0b1-4307a9df8fac
md"The **absolute utilisation** parameter ``\eta`` is defined as:"

# ╔═╡ f5e328c4-78a9-4dcf-ae4c-be0cbebd22bc
texeq"\eta = \frac{1}{1 - \ln(G + L)}, \quad G + L \ne 0"

# ╔═╡ a73f7666-885d-41a0-ad5c-d4766fad49aa
"Absolute utilisation parameter ``\\eta``"
η(G, L) = (G == L == 0) ? 0 : inv(1 - log(G + L))

# ╔═╡ 9db73561-e63b-4465-a89e-7348ab947ee3
md"""
Where ``\eta = 0`` if ``G + L = 0``.

Incentives ``I`` is allocated as follows:

**Treasury**

The allocation to the Treasury ``I_T`` is the imbalance generated from ``\upsilon``:
"""

# ╔═╡ d1a153a6-bc03-45a0-8f53-87a73fec022f
texeq"I_T = 1 - \upsilon \, \eta"

# ╔═╡ fa209a76-7aa3-4982-af79-24adbaa051e5
"Treasury allocation ``I_T(\\upsilon, \\eta) = 1 - \\upsilon \\, \\eta``."
I_T(υ, η) = 1 - υ * η

# ╔═╡ 7003c128-a295-44e2-9bb5-c116730b1f1b
md"""
The residual post Treasury allocation is shared four ways within 2 buckets:

**(1) A Bonds & G Staking**

Where ``S`` is the proportion of ``A`` tokens that are staked for Bonds (as defined previously in Section 4):

1. ``A`` Bonds, ``I_S``:
"""

# ╔═╡ 98b8d9d0-6d24-4caf-b3e6-d39223db54bb
texeq"I_S = S \, \frac{L^2}{G^2 + L^2}"

# ╔═╡ a8a43d83-8c08-45a0-befe-062b51b8be97
md"2. G Staking, ``I_G``:"

# ╔═╡ 81af7b29-664b-4c7c-a73d-95f5683d6dae
texeq"I_G = (1 − S) \, \frac{L^2}{G^2 + L^2}"

# ╔═╡ eba125ef-d4a8-43d2-a85b-04ae388675fd
"Normalized allocation ``\\tilde I_\\text{stake}(G, L) = \\frac{L^2}{G^2 + L^2}``."
Ĩ_stake(G, L) = L^2 / (G^2 + L^2)

# ╔═╡ ee13d8a9-7bd8-4e8b-be6e-b8c444793065
md"""
**(2) Liquidity**

With ``\lambda_G``, ``\lambda_Q``, ``\lambda_{GG}`` as defined in Section 8.3:

3. ``\overline{AG}`` Pool ``I_{AG}``
"""

# ╔═╡ d5ee99d4-1f0b-4617-8d8f-185a7b011703
texeq"I_{AG} = \frac{\lambda_G}{1 - \lambda_{GG}} \, \frac{G^2}{G^2 + L^2}"

# ╔═╡ 470a074d-c5f2-411d-aa92-74f4ea67c861
md"4. ``\overline{AQ}`` Pool ``I_{AQ}``:"

# ╔═╡ f220b77b-0790-4948-90cf-78e5a652bbba
texeq"I_{AQ} = \frac{\lambda_Q}{1 - \lambda_{GG}} \, \frac{G^2}{G^2 + L^2}"

# ╔═╡ 4e06e060-8b15-41cb-98d2-a7dd7e81d712
"Normalized allocation ``\\tilde I_\\text{liquidity}(G, L) = \\frac{L^2}{G^2 + L^2}``."
Ĩ_liquidity(G, L) = G^2 / (G^2 + L^2)

# ╔═╡ 55744a27-b7a0-4f02-9268-bc1b52467fe7
md"Figure 26: Share of Non-Treasury Incentives (1)(2)"

# ╔═╡ 09e058f0-249e-4d1d-a3df-48a121a6b3e6
begin
    G_values_fine = 0.0:0.005:1.0
    L_values_fine = 0.0:0.005:1.0
    G_points_fine = last.(Iterators.product(L_values_fine, G_values_fine))
    L_points_fine = first.(Iterators.product(L_values_fine, G_values_fine))
    Ĩ_stake_points = Ĩ_stake.(G_points_fine, L_points_fine)
    Ĩ_stake_points[G_points_fine .+ L_points_fine .> 1] .= NaN
    Plots.surface(
        G_points_fine,
        L_points_fine,
        Ĩ_stake_points,
        title="Normalized Allocation Ĩ to Bonds & G Staking",
        xlabel="Stake G",
        ylabel="Liquidity L",
        zlabel="Allocation Ĩ",
        markersize=2,
        colormap=:Spectral,
        camera=(315, 30),
        guidefontsize=8,
        tickfontsize=8,
    )
end

# ╔═╡ 5c2b64f1-2b26-4e51-a5aa-2256ba9b8609
begin
    Ĩ_liquidity_points = Ĩ_liquidity.(G_points_fine, L_points_fine)
    Ĩ_liquidity_points[G_points_fine .+ L_points_fine .> 1] .= NaN
    Plots.surface(
        G_points_fine,
        L_points_fine,
        Ĩ_liquidity_points,
        title="Normalized Allocation Ĩ to Liquidity Pools",
        xlabel="Stake G",
        ylabel="Liquidity L",
        zlabel="Allocation Ĩ",
        markersize=2,
        colormap=:Spectral,
        camera=(315, 28),
        guidefontsize=8,
        tickfontsize=8,
    )
end

# ╔═╡ 03219a80-d457-4fb6-9236-683e751b12f1
md"Figure 27: Treasury Incentives ``I_T``"

# ╔═╡ 58b51b55-53aa-4281-a444-e1d409f7f332
begin
    I_T_points = I_T.(
        υ.(G_points_fine, L_points_fine),
        η.(G_points_fine, L_points_fine),
    )
    I_T_points[G_points_fine .+ L_points_fine .> 1] .= NaN
    Plots.surface(
        G_points_fine,
        L_points_fine,
        I_T_points,
        title="Treasury Allocation I_T",
        xlabel="Stake G",
        ylabel="Liquidity L",
        zlabel="Allocation I",
        markersize=2,
        colormap=cgrad(:Spectral; rev=true),
        camera=(135, 28),
        guidefontsize=8,
        tickfontsize=8,
    )
end

